import React, {Component} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import '../styles/site.css';

export default class Home extends Component {

  constructor(props) {
    super(props);

    this.state= {
      home_title:'',
      home_description:''
    }
  }

  render() {
    return (
      <div id='home' className='section'>
      <h2> Home </h2>
      </div>
    )
  }
}
